function summarizeSessionTrades(session) {
    return session.trades.reduce((acc, trade) => {
        if (trade.type === 'buy') {
            acc.invested += trade.price * trade.volume;
            acc.volume += trade.volume;
        }
        else {
            acc.invested -= trade.price * trade.volume;
            acc.volume -= trade.volume;
        }
        return acc;
    }, {
        invested: 0,
        volume: 0
    });
}
